using CnClean.Models;
using CnClean.Services;
using CnClean.Services.Dsl;
using Microsoft.AspNetCore.Hosting;
using Microsoft.AspNetCore.Mvc;
using Microsoft.Extensions.Configuration;
using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Net.Http;
using System.Text;
using System.Text.Json;
using System.Text.Json.Nodes;
using System.Threading.Channels;
using System.Threading.Tasks;

namespace CnClean.Controllers
{
    [Route("gpt")]
    public class GptStudioController : Controller
    {
        private readonly IWebHostEnvironment _env;
        private readonly IDslService _dsl;
        private readonly IConfiguration _config;
        private readonly ProjectAtomizerService _atomizer;
        private readonly ValidationResolver _validator;
        private readonly Channel<AiAuditEntry> _auditChannel;
        private static readonly HttpClient _http = new() { Timeout = TimeSpan.FromMinutes(5) };

        private string OllamaUrl => _config["CausaNova:AI:OllamaUrl"] ?? "http://localhost:11434";
        private string ModelName => _config["CausaNova:AI:Model"] ?? "causanova-architect";

        public GptStudioController(
                    IWebHostEnvironment env,
                    IDslService dsl,
                    IConfiguration config,
                    Channel<AiAuditEntry> auditChannel,
                    ProjectAtomizerService atomizer,
                    ValidationResolver validator)
        {
            _env = env;
            _dsl = dsl;
            _config = config;
            _auditChannel = auditChannel;
            _atomizer = atomizer;
            _validator = validator;
        }

        // --- CORTEX EXECUTE (HTML Designer - bleibt hier) ---
        [HttpPost("api/cortex/execute")]
        public async Task<IActionResult> ExecuteCortex([FromBody] CortexRequest req)
        {
            string systemPrompt = req.Mode == "creation" ? BuildHtmlSystemPrompt("new") : BuildHtmlSystemPrompt("edit");
            string userPrompt = req.Mode == "creation" 
                ? $"USER REQUEST: {req.Message}\nCreate a complete new page." 
                : $"TASK: {req.Message}\nCONTEXT: {req.FullModel}";

            try
            {
                var payload = new
                {
                    model = ModelName,
                    messages = new[] { new { role = "system", content = systemPrompt }, new { role = "user", content = userPrompt } },
                    stream = false,
                    format = "json",
                    options = new { temperature = 0.3 }
                };

                var res = await _http.PostAsync($"{OllamaUrl.TrimEnd('/')}/api/chat", new StringContent(JsonSerializer.Serialize(payload), Encoding.UTF8, "application/json"));
                if (!res.IsSuccessStatusCode) return Ok(new { error = $"AI Error: {res.StatusCode}" });

                var doc = JsonDocument.Parse(await res.Content.ReadAsStringAsync());
                string replyJson = CleanJsonString(doc.RootElement.GetProperty("message").GetProperty("content").GetString());

                await AuditLogAsync(new AiAuditEntry { Channel = "studio.html", RequestText = req.Message, ResponseText = replyJson, RiskClass = "low" });
                await SaveDraftInternal(replyJson);

                return Ok(new { success = true, generatedJson = JsonNode.Parse(replyJson), replyText = "Vorschlag generiert." });
            }
            catch (Exception ex)
            {
                return Ok(new { error = ex.Message });
            }
        }

        // --- APPLY LOGIC (HTML Designer - bleibt hier) ---
        [HttpPost("/api/universal/gpt-apply")]
        public async Task<IActionResult> ApplyHtmlDraft([FromBody] ApplyDraftRequest req)
        {
            try
            {
                var sessionId = HttpContext.Session.Id ?? "guest_fallback";
                var tenantDir = Path.Combine(_env.ContentRootPath, "Data", "DSL", "onepage", "tenants", sessionId);
                var draftPath = Path.Combine(tenantDir, "gpt_draft.json");

                if (!System.IO.File.Exists(draftPath)) return BadRequest(new { message = "Draft not found." });
                var draftNode = JsonNode.Parse(await System.IO.File.ReadAllTextAsync(draftPath));

                // Onepage laden um Ziel zu finden
                var onePagePath = Path.Combine(tenantDir, "onepage.json");
                var onePageJson = JsonNode.Parse(await System.IO.File.ReadAllTextAsync(onePagePath));
                var sectionKey = req.ActiveSection ?? onePageJson["sections"]?.AsObject().First().Key;
                var targetFile = onePageJson["sections"][sectionKey]["file"].ToString();

                // Datei überschreiben
                string fullPath = Path.Combine(tenantDir, "views", onePageJson["sections"][sectionKey]["module"]?.ToString() ?? "default", targetFile);
                if (!System.IO.File.Exists(fullPath)) fullPath = Path.Combine(tenantDir, targetFile); // Fallback Root

                JsonNode newContent;
                if (draftNode is JsonObject obj && obj.ContainsKey("root")) newContent = obj["root"];
                else if (draftNode is JsonObject obj2 && obj2.ContainsKey("fields")) newContent = obj2;
                else newContent = new JsonObject { ["component"] = "container", ["fields"] = draftNode }; // Array Wrapper

                await System.IO.File.WriteAllTextAsync(fullPath, newContent.ToJsonString(new JsonSerializerOptions { WriteIndented = true }));
                return Ok(new { success = true });
            }
            catch (Exception ex) { return StatusCode(500, new { message = ex.Message }); }
        }

        [HttpPost("/api/universal/gpt-discard")]
        public IActionResult DiscardDraft()
        {
            var sessionId = HttpContext.Session.Id ?? "guest_fallback";
            var path = Path.Combine(_env.ContentRootPath, "Data", "DSL", "onepage", "tenants", sessionId, "gpt_draft.json");
            if (System.IO.File.Exists(path)) System.IO.File.Delete(path);
            return Ok();
        }

        // --- HELPERS ---
        private async Task AuditLogAsync(AiAuditEntry entry) => await _auditChannel.Writer.WriteAsync(entry);

        private async Task SaveDraftInternal(string json) {
             var path = Path.Combine(_env.ContentRootPath, "Data", "DSL", "onepage", "tenants", HttpContext.Session.Id ?? "guest_fallback", "gpt_draft.json");
             await System.IO.File.WriteAllTextAsync(path, json);
        }

        private string CleanJsonString(string text) {
            if (string.IsNullOrWhiteSpace(text)) return "{}";
            text = text.Trim();
            if (text.StartsWith("```json")) text = text.Substring(7);
            else if (text.StartsWith("```")) text = text.Substring(3);
            if (text.EndsWith("```")) text = text.Substring(0, text.Length - 3);
            return text.Trim();
        }

        private string BuildHtmlSystemPrompt(string mode) => "You are CausaNova AI. Output JSON only.";
    }
}

